import logo from './logo.svg';
import './App.css';
import {useState} from 'react'

function App() {
  const [firstDiv, setFirstDiv]=useState(false)
  const [secondDiv, setSecondDiv]=useState(false)
  const [thirdDiv, setThirdDiv]=useState(false)
  const [fourthDiv, setFourthDiv]=useState(false)
  const [fifthDiv, setFifthDiv]=useState(false)
  const [sixthDiv, setSixthDiv]=useState(false)
  const [seventhtDiv, setSeventhtDiv]=useState(false)
  const [eighthDiv, setEighthDiv]=useState(false)
  const [ninthDiv, setNinthDiv]=useState(false)
  const [count, setCount]=useState(0)
  const xSignt ="X"
  const ySignt ="Y"

  const firstDivClick=(e)=>{
    setFirstDiv(true)
    setCount(count+1)
    console.log(e.target.value)
  }



  return (
    <div className="App">
      <header className="App-header">
       <section>
        <div onClick={firstDivClick} >{firstDiv?value:null}</div>
        <div onClick={()=>{setSecondDiv(true)}}>{secondDiv?(count%2===1?"x":"o"):null}</div>
        <div onClick={()=>{setThirdDiv(true)}}>{thirdDiv?(count%2===1?"x":"o"):null}</div>
        <div onClick={()=>{setFourthDiv(true)}}>{fourthDiv?(count%2===1?"x":"o"):null}</div>
        <div onClick={()=>{setFifthDiv(true)}}>{fifthDiv?(count%2===1?"x":"o"):null}</div>
        <div onClick={()=>{setSixthDiv(true)}}>{sixthDiv?(count%2===1?"x":"o"):null}</div>
        <div onClick={()=>{setSeventhtDiv(true)}}>{seventhtDiv?(count%2===1?"x":"o"):null}</div>
        <div onClick={()=>{setEighthDiv(true)}}>{eighthDiv?(count%2===1?"x":"o"):null}</div>
        <div onClick={()=>{setNinthDiv(true)}}>{ninthDiv?(count%2===1?"x":"o"):null}</div>
       </section>
      </header>
    </div>
  );
}

export default App;
